window.bookSummaryJSON = "<p>In a galaxy filled with terrors, the brave men and women of the Union Special Services stand ever ready to defend humanity and those races under its protection from the dark. Listen for yourself the now declassified experience of one agent, codenamed “Friend”, on their mission to discover any possible threats to the Union within the Empire. And see through alien eyes how humanity’s meteoric rise to power is viewed in the broader galaxy.</p> <p>Inspired by stories from the HFY Subreddit.</p>"; 
